import { useState } from "react";
import FormField from "../../../UIComponents/FormField";

function Login() {
  const [formData, setFormData] = useState({
    login: "",
    password: "",
  });
  function SubmitForm(ev) {
    ev.preventDefault();
    console.log("valor del objeto del state formData....", formData);
  }
  function HandlerChangeEvents(name, value) {
    setFormData({
      ...formData,
      [name]: value,
    });
  }

  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <form className="row g-3" onSubmit={SubmitForm}>
            {[
              {
                id: "login",
                value: formData.login,
                type: "text",
                name: "login",
                label: "Nombre de usuario",
                placeholder: "Mi nombre de usuario",
              },
              {
                id: "password",
                value: formData.password,
                type: "password",
                name: "password",
                label: "Contraseña",
              },
            ].map((elemento) => (
              <div className="col-6 p-3 text-secondary" key={elemento.name}>
                <FormField
                  id={elemento.id}
                  type={elemento.type}
                  value={elemento.value}
                  name={elemento.name}
                  label={elemento.label}
                  onChangeInParent={HandlerChangeEvents}
                ></FormField>
              </div>
            ))}
            <div className="col-12">
              <button type="submit" className="btn btn-primary btn-lg">
                Iniciar Sesión
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}
export default Login;
